function Store() {
    return (
        <div className="grid grid-cols-4 gap-2  m-6">
            <div>
                  <h1 className="text-2xl font-semibold">Store</h1>
            </div>
            <div>
                  {[
                Array.from(Array(12)).map((_, index) => (
                    <div
                        key={index}
                        className="p-4 rounded-lg shadow-lg bg-slate-500 min-h-48"
                    >
                        Product {index + 1}
                    </div>
                )),
            ]}
            </div>
            
        </div>
    )
}

export default Store
